import React from 'react';
import ProductItem from './ProductItem';

function ProductList({ products, onAdd }) {
  return (
    <div className="col-md-8 product-list-container d-flex flex-column justify-content-between" style={{ height: '100%' }}>
      <h5><b>상품 목록</b></h5>
      <ul className="list-group products w-100">
        {products.map(product => (
          <li className="list-group-item px-4 py-3" style={{ width: '100%' }} key={product.id}>
            <ProductItem product={product} onAdd={onAdd} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ProductList;
